import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { strictEqual } from 'assert';

const HomeScreen = props => {
  return(
    <div className="home-wrap">

      <h1><span>Welcome to the portfolio of Kevin Macaraeg</span></h1>
      <img src={""}></img>

    </div>
  )
}

const Screen = props => {

  return (
    <div className="screen-wrap">
      {(() => {
        switch(props.screen) {
          case 'home':
            return <HomeScreen />
          default:
            return <h1>Didn't Work</h1>;
        }
      })()}
    </div>
  )

}

class App extends Component {

  state = {
    section: "home",
    text: "jello"
  }

  render() {
    return (
      <div className="app">
          <Screen screen={this.state.section} text={this.state.text}/>
      </div>
    );
  }
}

export default App;
